import React from 'react';
import ChatInterface from './ChatInterface';
import Typewriter from '../utils/typewriter';
import '../styles/components.css';

const Hero = () => {
  return (
    <section id="home">
      <div className="hero-content">
        <h1 className="hero-title">I Love working</h1>
        <p className="hero-subtitle">With <b> </b>  </p>
        <p className="hero-subtitle">
          <Typewriter 
            roles={[
              'AI Engineering',
              'Natural Language Processing(NLP)',
              'Computer Vision',
              'AI powered SWE',
              'Vibe coding',
              'Data Structure and Algorithm',
              'Agentic AI',
              'DevOps'
            ]}
          />
        </p>
        <p className="hero-description">
          MS in <span className="ai-highlight">Artificial Intelligence</span> @ <span className="rit-highlight">Rochester Institute of Technology</span><br />
          Actively looking for Full Time Opportunities
        </p>
        <ChatInterface />
      </div>
    </section>
  );
};

export default Hero;
